import React from 'react';

function MascotaTable({ mascotas, onDelete, onUpdate }) {
  const handleChange = (e, mascota, field) => {
    const updated = { ...mascota, [field]: e.target.value };
    onUpdate(updated);
  };

  return (
    <table border="1" style={{width: '100%', marginTop: '1em'}}>
      <thead>
        <tr>
          <th>ID</th>
          <th>Nombre</th>
          <th>Especie</th>
          <th>Raza</th>
          <th>Fecha Nac.</th>
          <th>ID Due√±o</th>
          <th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {mascotas.map(mascota => (
          <tr key={mascota.petId}>
            <td>{mascota.petId}</td>
            <td>
              <input type="text" value={mascota.name || ''} onChange={e => handleChange(e, mascota, 'name')} />
            </td>
            <td>
              <input type="text" value={mascota.species || ''} onChange={e => handleChange(e, mascota, 'species')} />
            </td>
            <td>
              <input type="text" value={mascota.breed || ''} onChange={e => handleChange(e, mascota, 'breed')} />
            </td>
            <td>
              <input
                type="date"
                value={mascota.birthDate ? mascota.birthDate.split('T')[0] : ''}
                onChange={e => handleChange(e, mascota, 'birthDate')}
              />
            </td>
            <td>{mascota.owner?.ownerId || ''}</td>
            <td>
              <button onClick={() => onDelete(mascota.petId)}>Eliminar</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default MascotaTable;
